# flake8: noqa: E501
from unittest.mock import MagicMock

from offchain.metadata.fetchers.metadata_fetcher import MetadataFetcher
from offchain.metadata.models.metadata import (
    MediaDetails,
    Metadata,
    MetadataField,
    MetadataFieldType,
    Attribute,
)
from offchain.metadata.models.token import Token
from offchain.metadata.parsers.collection.punks import PunksParser
from offchain.web3.contract_caller import ContractCaller


class TestPunksParser:
    token = Token(
        chain_identifier="ETHEREUM-MAINNET",
        collection_address="0xb7f7f6c52f2e2fdb1963eab30438024864c313f6",
        token_id=25,
        uri=None,
    )

    raw_data = {
        "title": "W#25",
        "name": "W#25",
        "description": "This Punk was wrapped using Wrapped Punks contract, accessible from https://wrappedpunks.com",
        "image": "https://api.wrappedpunks.com/images/punks/25.png",
        "external_url": "https://wrappedpunks.com",
    }

    def test_punks_parser_should_parse_token(self):  # type: ignore[no-untyped-def]
        fetcher = MetadataFetcher()
        contract_caller = ContractCaller()
        parser = PunksParser(fetcher=fetcher, contract_caller=contract_caller)  # type: ignore[abstract]
        assert parser.should_parse_token(token=self.token)

